INSERT INTO magentoadminnotification_inbox VALUES ('34', '4', '2010-04-23 20:09:03', 'Magento Version CE 1.3.3.0 Stable - Now Available With Support for 3-D Secure', 'Based on community requests, we are excited to announce the release of Magento CE 1.3.3.0-Stable with support for 3-D Secure. This release is intended for Magento merchants using version 1.3.x, who want to add support for 3-D Secure.', 'http://www.magentocommerce.com/blog/comments/magento-version-ce-1330-stable-now-available-with-support-for-3-d-secure/', '0', '1');
INSERT INTO magentoadminnotification_inbox VALUES ('35', '4', '2010-05-31 17:20:21', 'Announcing the Launch of Magento Mobile', 'The Magento team is pleased to announce the launch of Magento mobile, a new product that will allow Magento merchants to easily create branded, native mobile storefront applications that are deeply integrated with Magento’s market-leading eCommerce platform. The product includes a new administrative manager, a native iPhone app that is fully customizable, and a service where Magento manages the submission and maintenance process for the iTunes App Store.\n\nLearn more by visiting the Magento mobile product page and sign-up to be the first to launch a native mobile commerce app, fully integrated with Magento.', 'http://www.magentocommerce.com/product/mobile', '0', '1');
INSERT INTO magentoadminnotification_inbox VALUES ('36', '4', '2010-06-10 20:08:08', 'Magento CE Version 1.4.1.0 Stable is now available', 'We are excited to announce the availability of Magento CE Version 1.4.1.0 Stable for upgrade and download. Some of the highlights of this release include: Enhanced PayPal integration (more info to follow), Change of Database structure of the Sales module to no longer use EAV, and much more.', 'http://www.magentocommerce.com/blog/comments/magento-ce-version-1410-stable-now-available/', '0', '1');
INSERT INTO magentoadminnotification_inbox VALUES ('37', '3', '2010-07-23 16:30:20', 'New Extension – Ultimate SEO Suite by aheadWorks has been released!', 'The Ultimate SEO Suite extension adds canonical links to the header of each product page and optimizes Google sitemap.', 'http://blog.aheadworks.com/2010/07/new-magento-extension-ultimate-seo-suite/', '0', '1');
INSERT INTO magentoadminnotification_inbox VALUES ('38', '3', '2010-06-30 14:15:08', 'AJAX Cart Pro v.2.1 by aheadWorks has been released!', 'In the new version, a feature of \"configurable timer to close pop-up confirmation dialog\" has been implemented: now you can define after what time the confirm dialog box will be automatically closed. Moreover, AJAX Cart Pro works on the Compare Products and Wishlist pages as well. ', 'http://ecommerce.aheadworks.com/blog/2010/06/ajax-cart-pro-2-1-released/', '0', '1');
INSERT INTO magentoadminnotification_inbox VALUES ('39', '3', '2010-06-29 16:25:32', 'New Extension – Video Testimonials by aheadWorks has been released!', 'With the Video Testimonials extension both you and your customers can easily upload video from your computer or YouTube exactly on the product page.', 'http://ecommerce.aheadworks.com/blog/2010/06/new-magento-extension-video-testimonials/', '0', '1');
INSERT INTO magentoadminnotification_inbox VALUES ('40', '3', '2010-06-25 08:34:27', 'Blog v.1.0.20 by aheadWorks has been released!', 'aheadWorks is happy to announce that Blog has become compatible with Magento Enterprise 1.8 and now you can set up Blog Enterprise Edition or Blog Community Edition on your store.', 'http://ecommerce.aheadworks.com/blog/2010/06/the-blog-extension-is-now-compatible-with-enterprise-edition/', '0', '1');
INSERT INTO magentoadminnotification_inbox VALUES ('41', '3', '2010-06-16 15:35:20', 'aheadworks extensions are now compatible with Enterprise Edition 1.8', 'We are ready to announce that a number of aheadWorks extensions have been updated! Now the majority of our modules are fully compatible with Enterprise Edition 1.8.', 'http://ecommerce.aheadworks.com/blog/2010/06/aheadworks-extensions-are-now-compatible-with-enterprise-edition-1-8/', '0', '1');
INSERT INTO magentoadminnotification_inbox VALUES ('42', '3', '2010-05-20 12:57:55', 'New service - Magento Performance Optimization', 'Having gained huge experience in Magento development and optimization for a great number of our customers aheadWorks introduces new highly demanded service – Magento performance optimization. ', 'http://ecommerce.aheadworks.com/blog/2010/05/new-aheadworks-service-magento-performance-optimization-3/', '0', '1');
