INSERT INTO magentoadminnotification_inbox VALUES ('59', '3', '2010-09-21 15:15:01', 'New aheadWorks Reseller Program', 'Our Reseller Program is targeted at, and ideal, for software/ web application development companies, agencies or local integrators that develop and deliver Magento-based eCommerce solutions to their customers.', 'http://blog.aheadworks.com/2010/09/join-new-aheadworks-reseller-program/', '0', '0');
