INSERT INTO magentoadminnotification_inbox VALUES ('62', '3', '2010-09-28 14:25:33', 'AJAX Cart Pro v.2.2 by aheadWorks has been released!', 'Since v.2.2, the AJAX Cart Pro extension supports configurable products and items with custom options. Moreover, now product name is shown in confirmation dialog.', 'http://blog.aheadworks.com/2010/09/ajax-cart-pro-2-2-now-with-product-name-in-confirmation-dialog/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('63', '3', '2010-09-24 13:20:43', 'On Sale v.2.2 by aheadWorks has been released!', 'In On Sale v.2.2, three more label positions have been added - middle-left, middle-center, and middle-right. Moreover, we implemented a new live preview label position selector.', 'http://blog.aheadworks.com/2010/09/on-sale-2-2-%E2%80%93-now-with-new-label-positions/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('64', '3', '2010-09-23 12:27:12', 'Subscriptions and Recurring Payments v.1.4.1 by aheadWorks has been released!', 'The new version of Subscriptions and Recurring Payments makes the extension compatible with Magento CE 1.4.1. Moreover, not supported payment methods are disabled for subscription products at checkout page.', 'http://blog.aheadworks.com/2010/09/subscriptions-and-recurring-payments-v-1-4-1-released/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('65', '3', '2010-10-06 14:44:34', 'New Extension Configuration Service from aheadWorks', 'Now there\'s no need to spend your time learning configuration habits of each extension. Just let us know how you would like it to operate and we\'ll configure it and make sure it works for you!', 'http://blog.aheadworks.com/2010/10/new-extension-configuration-service-from-aheadworks/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('66', '3', '2010-10-07 14:57:34', 'Automatic Related Products v.1.1 by aheadWorks has released!', 'In the new version of the Automatic Related Products extension, if a product belongs to several categories, the choice of the related items is narrowed down to the currently viewing category only.', 'http://blog.aheadworks.com/2010/10/automatic-related-products-1-1-released/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('67', '3', '2010-10-12 10:20:18', 'Market Segmentation Suite v.1.1.3 by aheadWorks has been released!', 'The new version of Market Segmentation Suite makes the extension compatible with Magento Enterprise 1.9.', 'http://blog.aheadworks.com/2010/10/market-segmentation-suite-1-1-3-released/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('68', '3', '2010-10-11 13:40:48', 'AJAX Cart Pro v.2.2.1 by aheadWorks has been released!', 'Now AJAX Cart Pro supports downloadable products and allows your customers to add them exactly from the category page without being redirected to the product page.', 'http://blog.aheadworks.com/2010/10/ajax-cart-pro-2-2-1-%E2%80%93-now-with-downloadable-products-support/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('69', '3', '2010-10-18 14:38:41', 'Help Desk Ultimate v.2.6.4 by aheadWorks has been released!', 'Help Desk Ultimate is a perfect customer care and support solution with an efficient case tracking and resolution system. Today this Magento extension has been updated up to 2.6.4 version.', 'http://blog.aheadworks.com/2010/10/lead-the-process-of-customer-support-in-a-convenient-and-efficient-way/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('70', '3', '2010-11-04 15:40:51', 'AJAX Cart Pro v.2.2.2 by aheadWorks has been released!', 'Today we released the 2.2.2 version of AJAX Cart Pro. This minor version makes our module fully compatible with the Checkout Promo extension and now they cooperate without a hitch.', 'http://blog.aheadworks.com/2010/11/improve-user-experience-in-a-jiffy/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('71', '3', '2010-11-02 14:00:59', 'Home Tabs Pro v.1.0.2 by aheadWorks has been released!', 'In the 1.0.2 version of Home Tabs Pro, one more configurable tab which allows showing products from different categories has been added. Moreover, now you can hide out of stock products and display available for sale goods and services only.', 'http://blog.aheadworks.com/2010/11/display-top-products-at-the-home-page-of-your-store/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('72', '4', '2010-11-08 21:52:06', 'Magento CE Version 1.4.2.0-RC1 Preview Release Now Available', 'We are happy to announce the availability of Magento Preview Version 1.4.2.0-RC1 for download.', 'http://www.magentocommerce.com/blog/comments/magento-preview-version-1420-rc1-now-available/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('73', '3', '2010-11-10 15:50:55', 'Follow Up Email v.3.2.2 by aheadWorks has been released!', 'Since 3.2.2 version released today, Follow Up Email supports the Custom STMP Magento extension from aheadWorks.', 'http://blog.aheadworks.com/2010/11/avoid-abandoned-cart-syndrome-and-never-lose-track-of-your-customers/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('74', '3', '2010-11-08 15:30:52', 'Search Autocomplete and Suggest v.2.2 by aheadWorks has been released!', 'Today we released Search Autocomplete and Suggest v.2.2 where the module functionality has been improved by an added ability to hide out of stock products.', 'http://blog.aheadworks.com/2010/11/satisfy-the-customer%E2%80%99s-i-want-it-now-attitude/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('75', '3', '2010-11-17 17:00:00', 'Facebook Link v1.0.7 by aheadWorks has been released!', 'The new version of the Facebook Link extension has been released and some minor bugs have been fixed', 'http://blog.aheadworks.com/2010/11/socialize-your-store-with-facebook-link-extension/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('76', '3', '2010-11-24 13:20:00', 'iPhone Theme for Magento has been released!', 'It’s not just a simple Magento template – actually it’s a revolutionary hybrid of a superior theme and a full-value extension.\n Now say goodbye to annoying page reloads when adding items to cart or searching the store, and browse with simplicity.', 'http://blog.aheadworks.com/2010/11/iphone-theme-for-magento-has-been-released/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('77', '3', '2010-11-23 19:00:00', 'New extension - Pop-up+ v.1.0 by aheadWorks has been released!', 'We have released new Magento extension - Pop-up+. It allows you to push your products, news, ads and special events through attractive popup window and be sure that all your customers will see it. ', 'http://blog.aheadworks.com/2010/11/reach-your-audience-with-new-pop-up-extension-by-aheadworks/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('78', '3', '2010-11-19 18:00:00', 'Product Updates Notifications v.1.1.4 by aheadWorks has been released!', 'Today we have released the Product Updates Notifications extension v.1.1.4, where some minor bugs have been fixed', 'http://blog.aheadworks.com/2010/11/keep-your-customers-aware-of-all-your-hot-updates/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('79', '3', '2010-11-25 16:00:00', 'Checkout Promo v.1.2.0 by aheadWorks has been released!', 'Today we have released Checkout Promo v.1.2.0. Enrich your promotion strategy and increase your revenue per buyer.', 'http://blog.aheadworks.com/2010/11/increase-your-up-sells-with-new-checkout-promo/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('80', '4', '2010-12-02 20:33:00', 'Magento CE Version 1.4.2.0-RC2 Preview Release Now Available', 'We are happy to announce the availability of Magento Preview Version 1.4.2.0-RC2 for download.', 'http://www.magentocommerce.com/blog/comments/magento-preview-version-1420-rc2-now-available/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('81', '3', '2010-12-08 15:30:22', 'iPhone Theme v.1.1 by aheadWorks has been released!', 'Since 1.1 version, the iPhone Theme offers iOS 4.2 and Android compatibility what will be definitely appreciated by all smartphones wannabes.', 'http://blog.aheadworks.com/2010/12/make-mobile-shopping-in-your-store-a-snap-for-both-android-and-iphone-users/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('82', '3', '2010-12-07 15:37:37', 'Product Questions v.1.4 by aheadWorks has been released!', 'Today we released the 1.4 version of Product Questions which makes the extension’s work yet more stable as some minor bugs have been fixed.', 'http://blog.aheadworks.com/2010/12/discuss-your-products-with-your-prospects%E2%80%A6-and-sell-more/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('83', '3', '2010-12-06 18:00:54', 'New Extension – RMA by aheadWorks has been released!', 'The RMA (Return Merchandise Authorization) Magento module allows your customers to return the products bought to have them replaced or refunded within the admin specified warranty period.', 'http://blog.aheadworks.com/2010/12/provide-the-highest-standards-of-customer-service-with-the-rma-extension/', '0', '0');
INSERT INTO magentoadminnotification_inbox VALUES ('84', '3', '2010-12-03 15:40:30', 'Z-Blocks v.2.2.4 by aheadWorks has been released!', 'In the new version of the Z-Blocks Magento extension, if the Custom Position is specified for the block, the categories selection is not applied.', 'http://blog.aheadworks.com/2010/12/create-an-unlimited-number-of-static-blocks-with-z-blocks-v-2-2-4/', '0', '0');
