INSERT INTO magentoadminnotification_inbox VALUES ('87', '3', '2010-12-23 17:04:14', 'New Extension – Order Tags by aheadWorks has been released!', 'The Order Tags extension is a perfect solution for those who want to organize, prioritize, and filter orders by their attributes. Our Magento module gives store administrators an ability to set a tag (icon) for each order manually or specify conditions for their automatic assignment.', 'http://blog.aheadworks.com/2010/12/faster-orders-management-with-brand-new-order-tags-extension/', '0', '0');
