INSERT INTO magentocatalog_product_entity_text VALUES ('43', '4', '61', '0', '6', '<p>Crafting your way into someone\'s cupboard is the craftiest way into their heart: for $15, you get $30 toward pottery painting and glass fusing at Studio 6 Pottery. The cozy studio in Ocoee welcomes all ages and experience levels.</p>\r\n<p>Studio 6\'s cheerful pottery palace is a great place to get friends together for a small ceramics gathering, ceramics rave, or first ceramics date rave.</p>');
