INSERT INTO magentocatalog_product_entity_text VALUES ('47', '4', '61', '0', '7', 'People have been dreaming about video calling for decades. iPhone 4 makes it a reality. With the tap of a button, you can wave hello to your kids, share a smile from across the globe, or watch your best friend laugh at your stories &mdash; iPhone 4 to iPhone 4 over Wi-Fi. No other phone makes staying in touch this much fun.\r\n\r\niPhone 4 has two built-in cameras, one on the front above the display and one on the back next to the LED flash. The front camera has been tuned for FaceTime. It has just the right field of view and focal length to focus on your face at arm&rsquo;s length. So it always presents you in the best possible light.Imagine your sister is away at school and can&rsquo;t make it to your son&rsquo;s birthday. So you&rsquo;re cheering her up with a FaceTime call. As the cupcakes come out, your son&rsquo;s eyes light up, and you just have to share it. Tap a button, and before you can say, &ldquo;Make a wish,');
