INSERT INTO magentocms_block VALUES ('6', 'How to use coupon', 'coupon-use', '<p><span style=\"color: #181818; font-family: Arial, Helvetica, sans-serif; font-size: 20px;\"><strong>How to use this: </strong> </span></p>\r\n<p><span style=\"color: #181818; font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">1. Print coupon. We recommend that you re-use the back-side of this paper for your next coupon, and help reduce waste.  <br /> 2. Check the<strong> Fine Print.</strong> Make an appointment or reservation if required.  <br /> 3. Present coupon to merchant.  <br /> 4. Enjoy!  <br /><br />*Remember: Groupclone customers <strong>tip on the full amount</strong> of the pre-discounted service (and tip generously).  We support sustainable businesses because they share our values.</span></p>', '2010-11-01 08:25:52', '2010-12-02 09:52:25', '1');
