INSERT INTO magentocms_page VALUES ('14', 'Subscribe for Newsletter', 'one_column', '', '', 'subscribepage', '', '<div>\r\n<div>\r\n<p>{{block type=\"newsletter/subscribepage\" name=\"subscribepage\" &nbsp;template=\"page/html/subscribepage.phtml\"}}&nbsp;</p>\r\n</div>\r\n</div>', '2010-11-25 12:51:54', '2010-11-25 12:51:54', '1', '0', '<remove name=\"header\" />\r\n<remove name=\"footer\" />', '', '', '', null, null);
