     </table>\r\n                                            </td>\r\n                                        </tr>\r\n                                </table></td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td height=\"20\">&nbsp;</td>\r\n                            </tr>\r\n                    </table></td>\r\n                </tr>\r\n        </table></td>\r\n    </tr>\r\n</table>\r\n<table cellpadding=\"0\" cellspacing=\"0\"  width=\"750\">\r\n    <tr>\r\n        <td  height=\"30\">&nbsp;</td>\r\n    </tr>\r\n    <tr>\r\n        <td>\r\n            <table cellpadding=\"0\" cellspacing=\"0\"><tr>\r\n\r\n                    <td width=\"50%\">\r\n                    {{block id=\'coupon-use\'}} </td></tr></table></td>\r\n    </tr>\r\n    <tr>\r\n        <td  height=\"30\">&nbsp;</td>\r\n    </tr>\r\n    <tr>\r\n        <td >{{block id=\'coupon-footer\'}}</td>\r\n    </tr>\r\n    <tr>\r\n        <td  height=\"30\">&nbsp;</td>\r\n    </tr>\r\n    <tr>\r\n        <td  ><hr size=\"1\"/></td>\r\n    </tr>\r\n    <tr>\r\n        <td  height=\"10\">&nbsp;</td>\r\n    </tr>\r\n    <tr>\r\n\r\n    </tr>\r\n</table>', '', '2', '{{var deallist.subjectname}}', null, null, '2010-08-20 06:18:54', '2010-11-24 10:34:43', 'catalog_product_email_template', '');
INSERT INTO magentocore_email_template VALUES ('3', 'Newsletter', '<table cellpadding=\"0\" cellspacing=\"0\" border=\"1\" style=\"border:13px solid #7CCCF6\" width=\"750\" rules=\"groups\">\r\n  <tr>\r\n    <td ><table   cellspacing=\"0\" bgcolor=\"#343434\" width=\"100%\">\r\n        <tr>\r\n          <td height=\"15\"></td>\r\n        </tr>\r\n        <tr>\r\n          <td><table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\">\r\n              <tr>\r\n                <td width=\"20\"></td>\r\n                <td><a href=\"{{store url=\'\'}}\" target=\"_blank\" style=\"color:#1E7EC8;\"><img src=\"{{skin url=\'images/logo_email.gif\' _area=\'frontend\'}}\" alt=\"{{var store.getFrontendName()}}\" width=\"291\" height=\"36\"/></a></td>\r\n                <td align=\"right\"><font size=\"2\" color=\"#CCCCCC\" face=\"Arial, Helvetica, sans-serif\">{{var deallist.deal_date}}</font></td>\r\n                <td width=\"20\"></td>\r\n              </tr>\r\n            </table></td>\r\n        </tr>\r\n        <tr>\r\n          <td><table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n              <tr>\r\n                <td width=\"20\"></td>\r\n                <td><font size=\"4\" color=\"#FFFFFF\" face=\"Arial, Helvetica, sans-serif\">The Daily Deal For {{var deallist.product_city}}</font></td>\r\n              </tr>\r\n            </table></td>\r\n        </tr>\r\n        <tr>\r\n          <td height=\"15\"></td>\r\n        </tr>\r\n      </table></td>\r\n  </tr>\r\n  <tr>\r\n    <td><table cellpadding=\"0\" cellspacing=\"0\">\r\n            <tr><td colspan=\"3\" height=\"10\"></td></tr>\r\n        <tr>\r\n          <td width=\"20\"></td>\r\n          <td><table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n              <tr>\r\n                  <td ><font style=\"font-size:26px;color:#0981BE;font-family:Helvetica; \"><strong> {{var deallist.Productname}}</strong></font></td>\r\n              </tr>\r\n              <tr><td height=\"10\"></td></tr>\r\n              <tr>\r\n                <td ><table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\">\r\n                    <tr>\r\n                      <td width=\"43%\" valign=\"top\" ><table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\"  >\r\n                          <tr>\r\n                            <td ><table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\" bgcolor=\"#48A8C3\" >\r\n                                <tr>\r\n                                  <td height=\"5\" colspan=\"4\"></td>\r\n                                </tr>\r\n                                <tr>\r\n                                  <td width=\"3%\"></td>\r\n                                  <td><font style=\"font-size:28px;font-family:Helvetica,Arial;color:#fff;\"><strong>{{var deallist.currency_symbol}}{{var deallist.product_price}}</strong></font></td>\r\n                                  <td align=\"right\"><a href=\"#\"><img src=\"{{skin url=\'images/buynow.png\' _area=\'frontend\'}}\"/></a></td>\r\n                                  <td width=\"2%\"></td>\r\n                                </tr>\r\n                                <tr>\r\n                                  <td height=\"5\" colspan=\"4\"></td>\r\n                                </tr>\r\n                              </table></td>\r\n                          </tr>\r\n                          <tr>\r\n                              <td bgcolor=\"#CFEEF6\"><table cellpadding=\"0\" cellspacing=\"0\" border=\"1\" width=\"100%\" style=\"border:1px solid #7CCCF6\"  rules=\"groups\">\r\n                                <tr>\r\n                                  <td height=\"15\" colspan=\"3\"></td>\r\n                                </tr>\r\n                                <tr>\r\n                                    <td width=\"33%\" align=\"center\" style=\"font-size:12px;color:#000;font-family:Helvetica,Arial;\">Value<br/>\r\n                                        <font  style=\"font-family:Helvetica,Arial;font-size: 20px;color:#000;\"><strong>{{var deallist.currency_symbol}}{{var deallist.product_worth}}</strong></font></td>\r\n                                  <td width=\"33%\" align=\"center\" style=\"font-size:12px;color:#000;font-family:Helvetica,Arial;\">Discount<br/>\r\n                                    <font  style=\"font-family:Helvetica,Arial;font-size: 20px;color:#000;\"><strong>{{var deallist.discount}}%</strong></fontn</td>\r\n                                  <td width=\"33%\" align=\"center\" style=\"font-size:12px;color:#000;font-family:Helvetica,Arial;\">Save<br/>\r\n                                    <font  style=\"font-family:Helvetica,Arial;font-size: 20px;color:#000;\"><strong>{{var deallist.currency_symbol}}{{var deallist.product_saveprice}}</strong></font></td>\r\n                                </tr>\r\n                                <tr>\r\n                                  <td height=\"10\" colspan=\"3\"></td>\r\n                                </tr>\r\n                              </table></td>\r\n                          </tr>\r\n                          <tr>\r\n                            <td height=\"5\"></td>\r\n                          </tr>\r\n                          <tr>\r\n                              <td ><table cellpadding=\"0\" cellspacing=\"0\" border=\"1\" style=\"border:1px solid #7CCCF6\" rules=\"groups\" width=\"100%\" >\r\n                                <tr>\r\n                                  <td height=\"10\" colspan=\"3\"></td>\r\n                                </tr>\r\n                                <tr>\r\n                                  <td width=\"10\"></td>\r\n                                  <td><table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\">\r\n                                      <tr>\r\n                                          <td ><font  style=\"font-family:Helvetica;font-size: 13px;color: #000\"><strong>COMPANY INFORMATION</strong></font></td>\r\n                                      </tr>\r\n                                      <tr>\r\n                                        <td><hr color=\"#7CCCF6\" size=\"1\"/></td>\r\n                                      </tr>\r\n                                      <tr>\r\n                                        <td><font size=\"3\" color=\"#000000\" face=\"Arial, Helvetica, sans-serif\">{{var deallist.company_address}}</font></td>\r\n                                      </tr>\r\n                                    </table></td>\r\n                                  <td width=\"10\" align=\"right\"></td>\r\n                                </tr>\r\n                                <tr>\r\n                                  <td height=\"10\" colspan=\"3\"></td>\r\n                                </tr>\r\n                              </table></td>\r\n                          </tr>\r\n                        </table></td>\r\n                      <td width=\"2%\"></td>\r\n                      <td align=\"right\" width=\"65%\" ><img src=\"{{var deallist.productimage}}\" width=\"450\" height=\"300\"/></td>\r\n                    </tr>\r\n                  </table></td>\r\n              </tr>\r\n              <tr>\r\n                <td height=\"10\"></td>\r\n              </tr>\r\n              <tr>\r\n                  <td  ><font style=\"font-size:12px;line-height: 15px;color: #000;font-family: Helvetica;\">{{var deallist.product_description}}</font></td>\r\n              </tr>\r\n              <tr>\r\n                <td height=\"10\"></td>\r\n              </tr>\r\n            </table></td>\r\n          <td width=\"20\"></td>\r\n        </tr>\r\n\r\n        <tr>\r\n          <td bgcolor=\"#CFEEF6\" align=\"center\" height=\"30\" valign=\"middle\" colspan=\"3\" width=\"750\"><font size=\"3\" color=\"#000\" face=\"Arial, Helvetica, sans-serif\">Need help? Have feedback? Fell free to <a href=\"mailto:{{config path=\'trans_email/ident_support/email\'}}\">Contact Us</a></font> </td>\r\n        </tr>\r\n      </table></td>\r\n  </tr>\r\n</table>\r\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"750\">\r\n  <tr>\r\n    <td height=\"10\" colspan=\"3\"></td>\r\n  </tr>\r\n  <tr>\r\n\r\n      <td colspan=\"3\" align=\"center\"><font size=\"1\" color=\"#666\" face=\"Arial, Helvetica, sans-serif\">You are receiving this email because you signed up for the {{var store.getFrontendName()}} alerts.</font></td>\r\n\r\n  </tr>\r\n  <tr>\r\n\r\n      <td colspan=\"3\" align=\"center\"><font size=\"1\" color=\"#666\" face=\"Arial, Helvetica, sans-serif\">To unsubscribe <a href=\"{{store url=\'\'}}newsletter/subscriber/unsubscribe/id/{{var deallist.subscribe_id}}/code/{{var deallist.subscribe_code}}\">click here</a></font></td>\r\n\r\n  </tr>\r\n  <tr>\r\n    <td height=\"10\" colspan=\"3\"></td>\r\n  </tr>\r\n  <tr>\r\n    <td colspan=\"3\" ><hr color=\"#7CCCF6\"/></td>\r\n  </tr>\r\n  <tr>\r\n    <td height=\"10\" colspan=\"3\"></td>\r\n  </tr>\r\n  <tr>\r\n    <td align=\"center\" colspan=\"3\"><font size=\"1\" color=\"#666\" face=\"Arial, Helvetica, sans-serif\">Delivered by {{var store.getFrontendName()}}nCall us: {{config path=\'general/store_information/phone\'}}</font></td>\r\n  </tr>\r\n  <tr>\r\n    <td height=\"10\" colspan=\"3\"></td>\r\n  </tr>\r\n  <tr>\r\n    <td width=\"1%\"></td>\r\n    <td width=\"98%\" align=\"center\"><font size=\"1\" color=\"#666\" face=\"Arial, Helvetica, sans-serif\">To Purchase the {{var store.getFrontendName()}} voucher described in today\'s deal, you must press the Buy! Button follow the instructions. Once you make the purchase, you will receive the voucher via e-mail. This e-mail is not a valid {{var store.getFrontendName()}} voucher, even if you buy today\'s deal the only valid voucher is the voucher you receive via e-mail from {{var store.getFrontendName()}} after your Purchase</font></td>\r\n    <td width=\"1%\"></td>\r\n  </tr>\r\n</table>', '', '2', '{{config path=\"general/store_information/name\"}} Newsletter', null, null, '2010-08-20 09:38:40', '2011-03-03 13:11:49', 'catalog_newsletter_email_template', '');
INSERT INTO magentocore_email_template VALUES ('4', 'Deal Owner List', '<!--@vars\r\n{\"var deallist.content\":\"Sender Name\"\r\n@-->\r\n<div style=\"border: 5px solid rgb(222, 237, 204); margin: 5px 0pt; padding: 20px; width: 670px; \">\r\n      \r\n      \r\n {{var deallist.content}}\r\n</div>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n <tbody><tr>\r\n  <td style=\"padding: 0cm;\">\r\n\r\n  <p style=\"margin: 2.25pt; text-align: center;\" align=\"center\"><span style=\"font-size: 8.5pt; color: rgb(146, 146, 146);\">Delivered\r\n  by <a href=\'{{config path=\"web/secure/base_url\"}}\' title=\"Deal\" target=\"_blank\">{{var store.getFrontendName()}}</a> {{config path=\"general/store_information/address\"}} </span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>', '', '2', '{{config path=\"general/store_information/name\"}} List of Deals', null, null, '2010-08-20 09:39:30', '2010-09-24 11:51:42', 'catalog_email_email_template', '');
INSERT INTO magentocore_email_template VALUES ('5', 'Deal not achieved', '<table style=\"border:5px solid #000\" width=\"740\" cellpadding=\"0\" cellspacing=\"0\" rules=\"groups\" >\r\n    <tr>\r\n        <td><table bgcolor=\"#8C8C8C\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n                <tr>\r\n                    <td width=\"20\">&nbsp;</td>\r\n                    <td><a href=\"{{store url=\'\'}}\" style=\"color:#1E7EC8;\"><img src=\"{{skin url=\'images/logo_email.png\' _area=\'frontend\'}}\" alt=\"{{var store.getFrontendName()}}\" border=\"0\"/></a></td>\r\n                    \r\n                    <td width=\"20\">&nbsp;</td>\r\n                </tr>\r\n        </table></td>\r\n    </tr>\r\n    <tr>\r\n        <td style=\"padding:10px;\"><table cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n Thank you for participating in <strong>{{var deallist.storename}}</strong><br/>\r\n        <br/>\r\n        Unfortunately today \'s deal which is <strong>{{var deallist.productname}}</strong> has not been achieved.  End of the day we see only <strong>{{var deallist.purchasedqty}}</strong> deal purchased against <strong>{{var deallist.quantity}}</strong> target.<br/>\r\n        <br/>\r\n        So, this deal has been cancelled.<br/>\r\n        <br/>\r\n        Once again thank you for participating in deal</div>\r\n         </td>\r\n    </tr>\r\n</table>', '', '2', 'Thank you for participating {{var deallist.storename}}', null, null, '2010-11-24 11:18:46', '2010-11-24 11:18:46', '', '');
INSERT INTO magentocore_email_template VALUES ('6', 'Merchant Login Details', '<div style=\"font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;\">\r\n    <table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" width=\"98%\" style=\"margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;\">\r\n        <tr>\r\n            <td align=\"center\" valign=\"top\">\r\n                <!-- [ header starts here] -->\r\n                <table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" width=\"650\">\r\n                    <tr>\r\n                        <td valign=\"top\">\r\n                            <a href=\"{{store url=\"\"}}\"><img src=\"{{skin url=\"images/logo_email.gif\" _area=\'frontend\'}}\" alt=\"{{var store.getFrontendName()}}\"  style=\"margin-bottom:10px;\" border=\"0\"/></a></td>\r\n                    </tr>\r\n                </table>\r\n\r\n                <!-- [ middle starts here] -->\r\n                <table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" width=\"650\">\r\n                    <tr>\r\n                        <td valign=\"top\">\r\n                            <p><strong>Dear {{var merchant.name}}</strong>, <br/> Welcome to {{var store.getFrontendName()}}.</p>\r\n\r\n                            <p>Your e-mail {{var merchant.email}} has been confirmed in our store.</p>\r\n\r\n                            <p style=\"border:1px solid #BEBCB7; padding:13px 18px; background:#F8F7F5; \">\r\n                                Use the following values to log in:<br/>\r\n                                E-mail : {{var merchant.email}}<br/>\r\n                                UserName : {{var merchant.name}}<br/>\r\n                                Password : {{var merchant.password}}<p>\r\n\r\n                        </td>\r\n                    </tr>\r\n                </table>\r\n\r\n            </td>\r\n        </tr>\r\n    </table>\r\n</div>', '', '2', 'Merchant Login Details', null, null, '2011-03-04 13:01:45', '2011-03-09 10:26:08', '', '');
INSERT INTO magentocore_email_template VALUES ('7', 'Merchant Deal Add Template', '<div style=\"font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;\">\r\n    <table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" width=\"98%\" style=\"margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;\">\r\n        <tr>\r\n            <td align=\"center\" valign=\"top\">\r\n                <!-- [ header starts here] -->\r\n                <table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" width=\"650\">\r\n                    <tr>\r\n                        <td valign=\"top\">\r\n                            <a href=\"{{store url=\"\"}}\"><img src=\"{{skin url=\"images/logo_email.gif\" _area=\'frontend\'}}\" alt=\"{{var store.getFrontendName()}}\"  style=\"margin-bottom:10px;\" border=\"0\"/></a></td>\r\n                    </tr>\r\n                </table>\r\n\r\n                <!-- [ middle starts here] -->\r\n                <table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" width=\"650\">\r\n                    <tr>\r\n                        <td valign=\"top\">\r\n                            <p><strong>Dear Admin</strong>, </p>\r\n\r\n                            <p>A Merchant Added a New Deal in Your Store.</p>\r\n\r\n                            <p style=\"border:1px solid #BEBCB7; padding:13px 18px; background:#F8F7F5; \">\r\n                                Merchant deal details:<br/>\r\n                                Merchant Name : {{var merchant.merchantname}}<br/>\r\n                                Deal Name : {{var merchant.name}}<br/>\r\n                                City : {{htmlescape var merchant.city}}<p>\r\n                           <p>For more info, pls login and check you deal page.</p>\r\n                        </td>\r\n                    </tr>\r\n                </table>\r\n\r\n            </td>\r\n        </tr>\r\n    </table>\r\n</div>', '', '2', 'Merchant Deal Add Template', null, null, '2011-03-04 13:02:32', '2011-03-04 13:02:32', '', '');
INSERT INTO magentocore_email_template VALUES ('8', 'Referral system', '<table style=\"border:5px solid #000\" width=\"740\" cellpadding=\"0\" cellspacing=\"0\" rules=\"groups\" >\r\n    <tr>\r\n        <td><table bgcolor=\"#8C8C8C\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n                <tr>\r\n                    <td width=\"20\">&nbsp;</td>\r\n                    <td><a href=\"{{store url=\'\'}}\" style=\"color:#1E7EC8;\"><img src=\"{{skin url=\'images/logo_email.png\' _area=\'frontend\' }}\" alt=\"{{var store.getFrontendName()}}\" border=\"0\"/></a></td>\r\n                    <td align=\"right\" style=\"padding-top:10px;\"><font face=\"Arial, Helvetica, sans-serif\" size=\"5\" color=\"#FFFFFF\"></font></td>\r\n                    <td width=\"20\">&nbsp;</td>\r\n                </tr>\r\n        </table></td>\r\n    </tr>\r\n    <tr>\r\n        <td>\r\n	Dear {{var inviteList.friend_name}},<br/><br />\r\nYour friend <b> {{var inviteList.customer_name}}</b> has invited you to join with {{var store.getFrontendName()}}  for attractive offers.<br/><br />\r\n{{var inviteList.msg}}<br />\r\n<a href=\"{{var inviteList.invitation_link}}\">{{var inviteList.invitation_link}}</a><br /><br />\r\nWith best regards, <br />\r\n{{var store.getFrontendName()}} \r\n</td>\r\n    </tr>\r\n</table>', '', '2', '{{var inviteList.subject}}', null, null, '2011-03-04 14:52:47', '2011-03-04 14:52:47', '', '');
